import styled from 'styled-components'

export const j_ng = styled.div`
    width: 1190px;
    margin-left: auto;
    margin-right: auto;
    height: 260px;
    position: relative;
    -webkit-box-sizing: border-box;
    box-sizing: border-box;
    padding-left: 190px;
    margin-bottom: 20px;`
